import React, { useEffect, useState } from "react";
import { Magic } from "magic-sdk";

const magic = new Magic("pk_live_..."); // your magic key

function MagicLogin() {
  const [user, setUser] = useState(null);
  const [form, setForm] = useState({
    name: "", age: "", gender: "", dob: "", aadhaar: null, photo: null
  });
  const [profile, setProfile] = useState(null);

  useEffect(() => {
    magic.user.isLoggedIn().then(isLoggedIn => {
      if (isLoggedIn) magic.user.getInfo().then(setUser);
    });
  }, []);

  const handleLogin = async () => {
    await magic.auth.loginWithEmailOTP({ email: form.email });
    const info = await magic.user.getInfo();
    setUser(info);
  };

  const handleChange = e => {
    const { name, value, files } = e.target;
    setForm(prev => ({ ...prev, [name]: files ? files[0] : value }));
  };

  const handleRegister = async () => {
    const fd = new FormData();
    fd.append("aadhaar", form.aadhaar);
    fd.append("photo", form.photo);
    fd.append("name", form.name);
    fd.append("age", form.age);
    fd.append("gender", form.gender);
    fd.append("dob", form.dob);
    fd.append("email", user.email);
    fd.append("publicAddress", user.publicAddress);

    const r = await fetch("http://localhost:5001/register", {
      method: "POST",
      body: fd,
    });
    const json = await r.json();
    if (r.ok) {
      alert("Registered!");
      setProfile(json.user);
    } else {
      alert("Error: " + json.error);
    }
  };

  if (!user) {
    return (
      <div>
        <input type="email" name="email" placeholder="Email" onChange={handleChange} />
        <button onClick={handleLogin}>Login with Magic</button>
      </div>
    );
  }

  if (profile) {
    return (
      <div>
        <h2>Profile</h2>
        <p>Name: {profile.name}</p>
        <p>Age: {profile.age}</p>
        <p>Gender: {profile.gender}</p>
        <p>DOB: {profile.dob}</p>
        <p>Aadhaar: <a href={`https://gateway.pinata.cloud/ipfs/${profile.aadhaarHash}`} target="_blank" rel="noreferrer">View</a></p>
        <img src={`https://gateway.pinata.cloud/ipfs/${profile.photoHash}`} alt="photo" width="200" />
        <p>Tx: {profile.txHash}</p>
      </div>
    );
  }

  return (
    <div>
      <h3>Register Identity</h3>
      <input placeholder="Name" name="name" onChange={handleChange} /><br />
      <input placeholder="Age" name="age" type="number" onChange={handleChange} /><br />
      <input placeholder="Gender" name="gender" onChange={handleChange} /><br />
      <input placeholder="DOB" name="dob" type="date" onChange={handleChange} /><br />
      <input name="aadhaar" type="file" accept=".pdf,image/*" onChange={handleChange} /><br />
      <input name="photo" type="file" accept="image/*" onChange={handleChange} /><br />
      <button onClick={handleRegister}>Submit</button>
    </div>
  );
}

export default MagicLogin;
